-- ----------------------------
-- Table structure for `zam_leave`
-- ----------------------------
DROP TABLE IF EXISTS `zam_leave`;
CREATE TABLE `zam_leave` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `days` bigint(20) DEFAULT NULL COMMENT '请假天数',
  `content` varchar(200) DEFAULT NULL COMMENT '请假内容',
  `leave_time` datetime DEFAULT NULL COMMENT '请假时间',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `state` int(1) DEFAULT NULL COMMENT '流程状态 0 初始录入  1 开始审批   2审批完成',
  `userid` bigint(20) DEFAULT NULL COMMENT '请假人主键',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='请假信息表';

